import "../../App.css";
import cardBackground from './cardBackground'

function Card(props) {

    const url = "url(" +props.backgroundURL+ ")";

    const cardStyle = {
        backgroundImage: url,
        backgroundPosition: "center",
        height: "340px",
        width: "340px",
        margin: "0px 0px",
        marginTop: "0px",
        marginBottom: "50px",
        borderRadius: "10px",
    }

    let itemID = props.key;
    let itemKey = itemID;
    console.log(itemKey);


    return (
            <div className="card" style={cardStyle} key={itemKey} >
                <div className="cardOverlay">
                    <h2 className="cardTitle">{props.title}</h2>
                </div>
            </div>
    )
}

export default Card;
